ryPath/$APROFILE_FILENAME\" \"$archiveDirectoryPath/$executableName.mobileprovision\"\n\n\n# Generate .plist file for wireless app distribution\necho \"<?xml version=\\\"1.0\\\" encoding=\\\"UTF-8\\\"?>\n<!DOCTYPE plist PUBLIC \\\"-//Apple//DTD PLIST 1.0//EN\\\" \\\"http://www.apple.com/DTDs/PropertyList-1.0.dtd\\\">\n<plist version=\\\"1.0\\\">\n<dict>\n<key>items</key>\n<array>\n<dict>\n<key>assets</key>\n<array>\n<dict>\n<key>kind</key>\n<string>software-package</string>\n<key>url</key>\n<string>__URL__</string>\n</dict>\n</array>\n<key>metadata</key>\n<dict>\n<key>bundle-identifier</key>\n<string>$bundleIdentifier</string>\n<key>bundle-version</key>\n<string>$bundleVersion</string>\n<key>kind</key>\n<string>software</string>\n<key>title</key>\n<string>$bundleDisplayName</string>\n<key>subtitle</key>\n<string>$bundleShortVersionString</string>\n</dict>\n</dict>\n</array>\n</dict>\n</plist>\" > \"${CONFIGURATION_BUILD_DIR}/$executableName.plist\";\n\ncp \"${CONFIGURATION_BUILD_DIR}/$executableName.plist\" \"$archiveDirectoryPath/\"\nmv \"$archiveDirectoryPath/$executableName.plist\" \"$archiveDirectoryPath/$executableName.plist\"\n\n\nif ([ -e \"${PROJECT_DIR}/Icon@2x.png\" ])\nthen\necho \"Copying Icon@2x.png to release folder\"\ncp \"${PROJECT_DIR}/Icon@2x.png\" \"$archiveDirectoryPath/\"\nmv \"$archiveDirectoryPath/Icon@2x.png\" \"$archiveDirectoryPath/icon.png\"\nfi\n\n# Move the archived application to Dropbox\n#cp \"$archiveDirectoryPath/$executableName.ipa\" \"$dropboxDistributionDirectoryPath/$executableName.ipa\";\n\n\n\n\n# Open Terminal and upload the .ipa and .plist files\nif ([ \"$uploadMethod\" == \"ftp\" ])\nthen\necho \"Uploading $executableName.ipa and $executableName.plist to $ftpServerDirectoryPath...\";\n\n/usr/bin/osascript <<-EOF\non isApplicationRunning(application)\ntell application \"System Events\" to (name of processes) contains application\nend isApplicationRunning\n\nif not (isApplicationRunning(\"Terminal\")) then\ntell application \"